### create database and use it
CREATE DATABASE gestion_des_mendiants;
USE gestion_des_mendiants;

### create adminstrateurs table
CREATE TABLE `gestion_des_mendiants`.`administrateuers` ( `id` INT(10) NULL AUTO_INCREMENT , `username` VARCHAR(30) NULL , `password` VARCHAR(30) NULL , `email` VARCHAR(50) NOT NULL , `fullname` VARCHAR(50) NULL , PRIMARY KEY (`id`), UNIQUE (`username`))
ENGINE = InnoDB;

### create mendiant table
CREATE TABLE `gestion_des_mendiants`.`mendiants` ( `id_mendiant` INT(10) NULL , `nom` VARCHAR(30) NOT NULL DEFAULT 'mendiant' , `prenom` VARCHAR(30) NOT NULL DEFAULT 'mendiant' , `date_de_naissance` DATE NOT NULL , `id_chambre` INT(10) NOT NULL , PRIMARY KEY (`id_mendiant`))ENGINE = InnoDB;

### create formations table
CREATE TABLE `gestion_des_mendiants`.`formations` ( `id_formation` INT(10) NULL , `nom_formation` VARCHAR(100) NULL , `domaine` VARCHAR(100) NOT NULL , `date_debut` DATE NOT NULL , `date_fin` DATE NOT NULL , `formateur` VARCHAR(30) NOT NULL , PRIMARY KEY (`id_formation`))ENGINE = InnoDB;

### create former_mendiants table
CREATE TABLE `gestion_des_mendiants`.`former_mendiant` (`id_mendiant` INT, `id_formation`INT, PRIMARY KEY (`id_mendiant`, `id_formation`), FOREIGN KEY (`id_mendiant`) REFERENCES `mendiants`(`id_mendiant`), FOREIGN KEY (`id_formation`) REFERENCES `formations`(`id_formation`)) ENGINE = InnoDB;

### create activites table
CREATE TABLE `gestion_des_mendiants`.`activites` ( `id_activite` INT(10) NULL AUTO_INCREMENT , `nom_activite` VARCHAR(100) NULL , `domaine` VARCHAR(100) NOT NULL , `date_activite` DATE NOT NULL , PRIMARY KEY (`id_activite`))ENGINE = InnoDB;

### create mendiant activite
CREATE TABLE `gestion_des_mendiants`.`mendiant_activites` (`id_mendiant` INT, `id_activite`INT, PRIMARY KEY (`id_mendiant`, `id_activite`), FOREIGN KEY (`id_mendiant`) REFERENCES `mendiants`(`id_mendiant`), FOREIGN KEY (`id_activite`) REFERENCES `activites`(`id_activite`)) ENGINE = InnoDB;

### create chambre table
CREATE TABLE `gestion_des_mendiants`.`chambres` ( `id_chambre` INT(10) NULL , `capacite` INT(10) NOT NULL , PRIMARY KEY (`id_chambre`)) ENGINE = InnoDB;
## add id_chambre to mendiant table as a foreign key
ALTER TABLE `mendiants` ADD FOREIGN KEY (`id_chambre`) REFERENCES `chambres`(`id_chambre`);



